import React from 'react'
import DecktopIcon from './DesktopIcon/DecktopIcon';
import { NavLink } from 'react-router-dom';
import FolderIcon from "../../../Images/FolderIcon.png"
import MyComputerIcon from "../../../Images/MyComputer.png"
import s from "./Navbar.module.css";

const Navbar = () => {

    return (
        <div className={ s.Navbar }>
            <DecktopIcon TextStyle={s.CoousingText} image = { MyComputerIcon } name = {"Об олимпиаде"}/>
                <DecktopIcon TextStyle={s.CoousingText} image = { FolderIcon } name = {"Направления"}/>
            <NavLink className={s.Link} to="/Olimpiad/Stages">
                <DecktopIcon TextStyle={s.CoousingText} image = { FolderIcon } name = {"Этапы"}/>
            </NavLink>
            <NavLink className={s.Link} to="/Olimpiad/Sponsors">
                <DecktopIcon TextStyle={s.CoousingText} image = { FolderIcon } name = {"Спонсоры"}/>
            </NavLink>
            <NavLink className={s.Link} to="Registration">
                <DecktopIcon TextStyle={s.CoousingText} image = { FolderIcon } name = {"Регстрация"}/>
            </NavLink>
        </div>
    );
}


export default Navbar;
